import React from 'react';
import { Link } from 'react-router-dom';

const NavBar = () => {
  return (
    <div className="NavBar">
      <ul className="list-inline">
        <li className="active"><Link to="#">Coches</Link></li>
        <li><Link to="#">Packages</Link></li>
      </ul>
    </div>
  );
};

export default NavBar;
